Actualmente se realizaron <b>4 muestreos</b>, en los que se recolectaron <b>32 muestras de agua</b>.

En todos los casos, no se aprecia presencia de nubes sobre los puntos de toma de muestras.

Los ocho sitios muestrales se nombran correlativamente de `P1` a `P8`, iniciando en la <b style='color:#B86092'>orilla chaqueña</b> y finalizando en la <b style='color:#007E2E'>costa de Corrientes</b>.

